import React, { useEffect, useState } from 'react';
import { useAuth } from '../AuthProvider';
import Navbar from '../components/NavBar';
import "../styles/ListFacturas.css";

const InvoiceList = () => {
  const [facturas, setFacturas] = useState([]);
  const [mensaje, setMensaje] = useState('');
  const [filtroCliente, setFiltroCliente] = useState('');
  const [filtroCedula, setFiltroCedula] = useState('');
  const auth = useAuth();

  const formatNumber = (number) => {
    return number.toLocaleString('es-ES');
  };

  useEffect(() => {
    const fetchFacturas = async () => {
      try {
        const response = await fetch('http://localhost:3000/factura', {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json',
            Authorization: auth.token,
          },
        });

        if (response.ok) {
          const data = await response.json();
          setFacturas(data.data);
        } else {
          throw new Error('Error al cargar las facturas');
        }
      } catch (error) {
        console.error('Error al obtener las facturas:', error.message);
        setMensaje('Error al cargar las facturas');
      }
    };

    fetchFacturas();
  }, [auth.token]);

  const handleFiltroClienteChange = (e) => {
    setFiltroCliente(e.target.value);
  };

  const handleFiltroCedulaChange = (e) => {
    setFiltroCedula(e.target.value);
  };

  const filteredFacturas = facturas.filter((factura) => {
    const matchNombre = factura.nombre.toLowerCase().includes(filtroCliente.toLowerCase());
    const matchApellido = factura.apellidos.toLowerCase().includes(filtroCliente.toLowerCase());
    const matchCedula = factura.cedula.includes(filtroCedula);
    return (matchApellido);
  });

  return (
    <div>
      <Navbar />
      <div className="backgroundPL">
        <div className="containerPL">
          <h2>Lista de Facturas</h2>
          {mensaje && <div id="mensaje">{mensaje}</div>}
          <div className="filtro-container">
            <label htmlFor="filtroCliente">Filtrar por Cliente (Nombre o Apellido):</label>
            <input
              type="text"
              id="filtroCliente"
              name="filtroCliente"
              value={filtroCliente}
              onChange={handleFiltroClienteChange}
            />
            <label htmlFor="filtroCedula">Filtrar por Cédula:</label>
            <input
              type="text"
              id="filtroCedula"
              name="filtroCedula"
              value={filtroCedula}
              onChange={handleFiltroCedulaChange}
            />
          </div>
          <table className="tablePL">
            <thead>
              <tr>
                <th>ID</th>
                <th>Fecha</th>
                <th>Cédula</th>
                <th>Nombre</th>
                <th>Apellidos</th>
                <th>Usuario</th>
                <th>Subtotal</th>
                <th>Total a Pagar</th>
              </tr>
            </thead>
            <tbody>
              {filteredFacturas.map((factura) => (
                <tr key={factura.id_factura}>
                  <td>{factura.id_factura}</td>
                  <td>{factura.fecha}</td>
                  <td>{factura.cedula}</td>
                  <td>{factura.nombre}</td>
                  <td>{factura.apellidos}</td>
                  <td>{factura.nombre_usuario}</td>
                  <td>$ {formatNumber(factura.subtotal)}</td>
                  <td>$ {formatNumber(factura.total_pagar)}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default InvoiceList;
